// StateList.js

import React, { useState, useEffect } from 'react';

const StateList = () => {
  const [stateList, setStateList] = useState([]);

  useEffect(() => {
    // For now, use a sample list if not using the server API
    const sampleStates = [
      { _id: 1, name: 'Andhra Pradesh' },
      { _id: 2, name: 'Maharashtra' },
      // Add more states
    ];

    setStateList(sampleStates);
  }, []);

  return (
    <div>
      <h2>State List</h2>
      <ul>
        {stateList.map((state) => (
          <li key={state._id}>
            <a href={`/state/${state._id}`}>{state.name}</a>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default StateList;
